Malayalam satirical film written, directed, and produced by Ranjith.[1][4] The film centres on the fictitious conversation between the Thrissur based rice businessman C.E. Francis aka Pranchiyettan (Mammootty) and St. Francis of Assisi (Jesse Fox Allen). Priyamani,[5][6] Innocent, Siddique, Khushboo, Jagathy Sreekumar, Ganapathy, Sasi Kalinga, and Biju Menon play the other important roles.
The film features the work of five National Award-winning artists: Mammootty, Priyamani, Ranjith, Venu (the cinematographer of the film) and Ouseppachan, who scored the music for the film.[1] The film was well received critically and was a box 
office smash, grossing around 3 crores within fifteen days.



